import React, { Component } from 'react';

class HeaderComponent extends Component {
    render() {
        return (
            <div>
                <header id="header" class="d-flex flex-column justify-content-center">

                    <nav className="navbar nav-menu">
                        <h2>D'VILLA EMPLOYEE'S LIST</h2>
                        <ul>
                           <li><a href="#hero" class="nav-link scrollto active"><i class="bx bx-home"></i> <span>Register</span></a></li>
                           <li><button><i class="bx bx-user"></i> <span>View Employed Staff</span></button></li>
                        </ul>
                    </nav>

                </header>
            </div>
        );
    }
}

export default HeaderComponent;
